import Vue from 'vue'
import store from  './store'
import router from './router'
import App from './App.vue'

import axios from 'axios'
axios.defaults.baseURL = '127.0.0.1:8080';
Vue.config.productionTip = false

new Vue({
  router,
  store,
  render: h => h(App),
  beforeCreate(){
    this.$ajax=axios;
  }
}).$mount('#app')
